import React ,{Component} from 'react';
import {
  DetailWrapper
}from './style.js';
class Detail extends Component {
  render(){
    return (
        <DetailWrapper>衡水中学，被外地人占领的高考工厂</DetailWrapper>
    )
  }
}

export default Detail;
